import React, { Component } from 'react';
import { connect } from 'react-redux';
import moment from 'moment-js';
import { Link } from 'react-router-dom';

// import { getUserPosts } from '../../actions';
import { getUserItems, getAllItems } from '../../actions';



class Sandbox extends Component {


    // componentWillMount() {
    componentDidMount() {
        this.props.dispatch(getUserItems(this.props.user.login.id))
        this.props.dispatch(getAllItems())

    }



    showUserItems = (items) => (
        items.items ?
            items.items.map(item => (
                <span key={item._id}> 


							{/* <span>cp ./sq_thumb/</span>
                            { item.omeka ?
								item.omeka.omeka_id
                            : null}
							<span>.jpg</span> */}



							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/0.jpg; </span>							
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_2.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/1.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_3.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/2.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_4.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/3.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_5.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/4.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_6.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/5.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_7.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/6.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_8.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/7.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_9.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/8.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_10.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/9.jpg; </span><br />
							<span>mv -v ./fullsize/</span>{ item.omeka ? item.omeka.omeka_id: null}<span>_11.jpg ./items/</span>{ item.omeka ? item._id: null}<span>/fullsize/10.jpg; </span><br /><br />


							{/* <span>;</span> */}
							{/* <br/> */}
                </span>
            ))
        : null
    )


    render() {
        // console.log(this.props);

        let items = this.props.items;

        return (
            <div className="user_posts">

                        {this.showUserItems(items)}

            </div>
        );
    }
}

function mapStateToProps(state) {

    console.log(state);
    return {
        user:state.user,
        items:state.items
    }
}


export default connect(mapStateToProps)(Sandbox)
